import './App.css';
import { BrowserRouter as Router, Switch } from 'react-router-dom';
import Home from './components/pages/Home';

function App() {
  return (
    <>
      <Router>
        <Switch>
          <Route path='/' exact component= {Home} />
        </Switch>
      </Router>

    </>
  );
}

export default App;
